    public String stringReductionFast(String S) {
        // write your code in Java SE 8
        logger.info("Length: ", S.length());

        StringBuilder reducedString = new StringBuilder();
        for (char ch : S.toCharArray()) {

            if (reducedString.length() > 0 && reducedString.charAt(reducedString.length() - 1) == ch) {
                reducedString.deleteCharAt(reducedString.length() - 1);
            } else {
                reducedString.append(ch);
            }
        }

        return reducedString.toString();
    }


    public String stringReductionSlow(String S) {
        // write your code in Java SE 8

        // Loop through char array
        // If X and X + 1 chars are same, they can be removed
        // Recursively check

        int charIndex = 0;
        StringBuilder newString = new StringBuilder(S);

        while (charIndex + 1 < newString.length()) {
            if (newString.charAt(charIndex) == newString.charAt(charIndex + 1)) {
                newString.delete(charIndex, charIndex + 2);
                charIndex = 0;
            } else {
                charIndex++;
            }
        }

        return newString.toString();
    }

    public static int arrayInversionCountSlow(int[] A) {
        int inversionCount = 0;

        // loop arrays
        for (int firstIndex = 0; firstIndex < A.length; firstIndex++) {
            for (int secondIndex = firstIndex + 1; secondIndex < A.length; secondIndex++) {
                // compute inversion
                if (A[firstIndex] > A[secondIndex]) {
                    inversionCount++;
                    // return -1 if exceeds 1,000,000,000 inversions
                    if (inversionCount > 1000000000) {
                        return -1;
                    }
                }
            }
        }
        // handle first and last item edge case

        return inversionCount;
    }


    public static int solution(int[] A) {
        HashMap<Integer, Integer> numbersMap = new HashMap<Integer, Integer>();

        for (int i = 0; i < A.length; i++) {
            Integer currentCount = numbersMap.get(A[i]);
            if (currentCount == null) {
                numbersMap.put(A[i], 1);
            } else {
                numbersMap.put(A[i], currentCount + 1);
            }
        }

        for (int i = 0; i < A.length; i++) {
            if (numbersMap.get(A[i]) != null && numbersMap.get(A[i]) == 1) {
                return A[i];
            }
        }

        return -1;
    }
